text:
@GBBShah #बलिप्रथा_बन्द_गरौँ
👉🏻 पशु बलि एक क्रूर कर्म हो। हामीले कुनै पशुको बलि नभएर आफूमा भएका अवगुणहरुको बलि दिनुपर्छ।

Save Animals https://t.co/xcAdt6DE2i

@SharmaNeu जिउँदै लुछेर खानेहरुलाई सोध्नुपर्छ ।
आफ्नो त सिधा कुरो
पशुपंछिको व्यवसायिक खेति गरिन्छ र तिनको बलि दिएर सरसफाइ गरि पकाएर खाईन्छ ।
